import { Card } from "antd";



function HrManagerHomepage (){
    const handleClick = () => {
        window.open("/applicanthomepage");
      };

        return (
            <div>
        <PreLoginHrLayout>

        <Card>
        <img src={"./businesshome.png"} alt="Logo" />;
        </Card>

                 <button onClick={handleClick}>Applicant</button>

        </PreLoginHrLayout>
            </div>
        )
}
export default HrManagerHomepage;
